generated.css:
body {
  font-family: "Open Sans", sans-serif;
  height: 100%;
  color: #293c4b;
  animation: fadein 2s;
  margin: 0;
}

@keyframes fadein {
  from {
    opacity: 0;
  }
  to {
    opacity: 1;
  }
}

#textInput {
  position: absolute !important;
  height: 1px;
  width: 1px;
  overflow: hidden;
  clip: rect(1px, 1px, 1px, 1px);
}

#container {
  height: 100vh;
  display: flex;
  justify-content: center;
  align-items: center;
}

.feedback {
  word-wrap: break-word;
  word-break: break-word;
  width: 80vw;
  font-size: 28px;
  font-weight: 400;
  margin-bottom: 1em;
  line-height: 150%;
  padding: 2rem;
  border-radius: 0.5rem;
}

.btn {
  border: none;
  font-family: inherit;
  font-size: inherit;
  color: inherit;
  background: none;
  cursor: pointer;
  padding: 0.8em 2em;
  display: inline-block;
  text-transform: uppercase;
  letter-spacing: 1px;
  font-weight: 700;
  outline: none;
  position: relative;
  -webkit-transition: all 0.3s;
  -moz-transition: all 0.3s;
  transition: all 0.3s;
}

.btn-green {
  background: #17aa56;
  color: #fff;
  border-radius: 7px;
}

.btn-green:hover,
.btn-green:focus {
  background: #2ac56c;
}

.wpmBar {
  display: flex;
  justify-content: flex-end;
}
